import React from 'react'
import useSticky from './hooks/useSticky.js'
import Home from './components/Header/Home'
import Navbar from './components/Header/Navbar'

function App() {
    const { isSticky } = useSticky()
    return (
        <>
            <Navbar sticky={isSticky} />
            <Home />
        </>
    )
}

export default App
